import 'semantic-ui-css/semantic.min.css'
import '../public/static/css/styles.css';
import { Container } from 'semantic-ui-react';

export default function MyApp({ Component, pageProps }) {
  return  (
      <Container>
  <Component {...pageProps} />
  </Container>
  )
}
